import React, { useState } from "react";
import mapboxgl from 'mapbox-gl';
import subways from './data/subways.json';
import ReactMapGL, {Source, Layer} from 'react-map-gl';

const MAPBOX_TOKEN = 'pk.eyJ1IjoiYW1jMjM3NSIsImEiOiJjazJ3MnRuMXkwOHdyM25xd3V2aWp6ZWduIn0.DLl2wPIb3rDT72TZ0V7z5w';

function RenderMap2() {

    const [viewport, setViewport] = useState({
        width: 600,
        height: 500,
        latitude: 40.74,
        longitude: -73.9,
        zoom: 9.3
    })
    const subwaysLayer = {
        id: 'subways',
        type: 'circle',
        source: 'subways',
        // paint: {
        //    ' circle-color' : 'black',
        //     'circle-opacity': 0.2
        // }

    }
    return (
        <ReactMapGL 
            {...viewport}
            onViewportChange = {nextViewport => setViewport(nextViewport)}
            mapboxApiAccessToken = {MAPBOX_TOKEN}
            >
                <Source type = 'geojson' data = {subways}>
                    <Layer {...subwaysLayer} />
                </Source>
            </ReactMapGL>

    )
}

export default RenderMap2;
